        return new Source("{% extends 'base.html.twig' %}

{% block title %}Adress index{% endblock %}

{% block body %}
    <h1>Adress index</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>FullName</th>
                <th>Campany</th>
                <th>Complement</th>
                <th>Phone</th>
                <th>City</th>
                <th>Postal</th>
                <th>Country</th>
                <th>NomDeRue</th>
                <th>NumeroDeRue</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for adress in adresses %}
            <tr>
                <td>{{ adress.id }}</td>
                <td>{{ adress.fullName }}</td>
                <td>{{ adress.campany }}</td>
                <td>{{ adress.complement }}</td>
                <td>{{ adress.phone }}</td>
                <td>{{ adress.city }}</td>
                <td>{{ adress.postal }}</td>
                <td>{{ adress.country }}</td>
                <td>{{ adress.nomDeRue }}</td>
                <td>{{ adress.numeroDeRue }}</td>
                <td>
                    <a href=\"{{ path('adress_show', {'id': adress.id}) }}\">show</a>
                    <a href=\"{{ path('adress_edit', {'id': adress.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"11\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('adress_new') }}\">Create new</a>
{% endblock %}
